import react from 'react';
import './styles.css';

var Header = () => {
    return(
        <div>
            <nav className="navbar navbar-expand-sm bg-dark navbar-dark">
                <a className="navbar-brand" href="#">Logo</a>
                <ul className="navbar-nav">

                </ul>
            </nav>
        </div>
    );
}

export default Header;
